import React from 'react'
import { Link } from 'react-router-dom'

const header = () => {
  return (
    <header>
      <Link  to="/" className='text-xl font-semibold'>Home.</Link>
        <div>
          <img src='/assets/images/iconCart.png' alt='' />
        </div>
    </header>
  )
}

export default header
